import React, { Component } from 'react';
import About from './about';
import HomePage from './homepage';
import Contact from './contact';
import {Link} from 'react-scroll';
import './navstyle.css';
import Aos from 'aos';

Aos.init({
 duration: 1200
});


class Nav extends Component {
  render(){
   return (
      <div data-aos="fade-out" className='navbar' style={{backgroundColor:'transparent'}}>
      <h2 style={{paddingLeft:30,color:'white'}}>Anjali</h2>
      <div style={{position:'absolute',left:800,color:'white'}}>
       <Link
          activeClass="active"
          to="homepage"
          spy={true}
          smooth={true}
          offset={0}
          duration= {500}
      ><span className='heading'>Homepage</span></Link>
       <Link
          style={{marginLeft:20}}
          activeClass="active"
          to="about"
          spy={true}
          smooth={true}
          offset={0}
          duration={500}
      ><span className='heading'>About</span></Link>
      <Link
          style={{marginLeft:20}}
          activeClass="active"
          to="skills"
          spy={true}
          smooth={true}
          offset={0}
          duration= {500}
      ><span className='heading'>Skills</span></Link>
      <Link
          style={{marginLeft:20}}
          activeClass="active"
          to="resume"
          spy={true}
          smooth={true}
          offset={0}
          duration= {500}
      ><span className='heading'>Resume</span></Link>
      <Link
          style={{marginLeft:20}}
          activeClass="active"
          to="portfolio"
          spy={true}
          smooth={true}
          offset={0}
          duration= {500}
      >Portfolio</Link>
       <Link
          style={{marginLeft:20}}
          activeClass="active"
          to="contact"
          spy={true}
          smooth={true}
          offset={0}
          duration= {500}
      >Contact</Link>
     </div>
      
  </div>
    );
  }
}

export default Nav;
